params.text:
query RankingsPageQuery(
  $chain: [ChainScalar!]
  $count: Int!
  $cursor: String
  $sortBy: CollectionSort
  $parents: [CollectionSlug!]
  $createdAfter: DateTime
) {
  ...RankingsPage_data
}

fragment PaymentAssetLogo_data on PaymentAssetType {
  symbol
  asset {
    imageUrl
    id
  }
}

fragment RankingsPage_data on Query {
  rankings(after: $cursor, chains: $chain, first: $count, sortBy: $sortBy, parents: $parents, createdAfter: $createdAfter) {
    edges {
      node {
        createdDate
        name
        slug
        logo
        isVerified
        nativePaymentAsset {
          ...PaymentAssetLogo_data
          id
        }
        statsV2 {
          floorPrice {
            unit
            eth
          }
          numOwners
          totalSupply
          sevenDayChange
          sevenDayVolume {
            unit
          }
          oneDayChange
          oneDayVolume {
            unit
          }
          thirtyDayChange
          thirtyDayVolume {
            unit
          }
          totalVolume {
            unit
          }
        }
        id
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
}
